  false,\n\t\"url\": null,\n\t\"notes\": \"The IMP is an operational plan that provides
  management rationale and logistical considerations of surveys, and is consistent
  with the stationu2019s Comprehensive Conservation Plan. This IMP documents natural
  resource surveys that will be conducted at the Quivira National Wildlife Refuge
  from 2015 through 2028, or until the refuge Comprehensive Conservation Plan (CCP)
  or this IMP are revised. The majority of surveys considered in this plan address
  resource management objectives identified in the CCP (2013). Other surveys are a
  continuation of past monitoring conducted for tracking long-term trends in specific
  resources, understanding ecological interactions, or are part of regional and national
  survey efforts. This IMP was developed as per the Inventory and Monitoring (I&M)
  policy (701 FW 2) for the National Wildlife Refuge System (NWRS).\",\n\t\"owner_org\":
